import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 33.2-1022 Certificates to describe land and list owner.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1022.md","filePath":"vacode/33.2-1022.md"}'),r={name:"vacode/33.2-1022.md"},n=i('<h1 id="§-33-2-1022-certificates-to-describe-land-and-list-owner" tabindex="-1">§ 33.2-1022 Certificates to describe land and list owner. <a class="header-anchor" href="#§-33-2-1022-certificates-to-describe-land-and-list-owner" aria-label="Permalink to &quot;§ 33.2-1022 Certificates to describe land and list owner.&quot;">​</a></h1><p>The certificate shall set forth the description of the land or interest therein being taken or damaged and, if known, the owner. If a temporary construction easement is being acquired, the certificate shall set forth the calendar date on which it shall expire, if such date is known or can be reasonably estimated, or, if certified that such date is not known, at such time the date is ascertained, the Commissioner of Highways shall file certification of the information as provided by subsection B of § <a href="/vacode/25.1-307/">25.1-307</a> and shall simultaneously provide the landowner or the landowner&#39;s counsel, if any, a copy of such certification.</p><p>Code 1950, § 33-70.5; 1958, c. 581; 1970, c. 322, § 33.1-123; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>; 2022, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0735" target="_blank" rel="noreferrer">735</a>.</p>',3),o=[n];function s(c,d,l,h,f,_){return t(),a("div",null,o)}const u=e(r,[["render",s]]);export{m as __pageData,u as default};
